import { uploadPhoto } from './5-photo-reject.js';

export async function handleProfileSignup(firstName, lastName, fileName) {
    try {
        const signUpPromise = signUpUser(firstName, lastName);
        const uploadPromise = uploadPhoto(fileName);

        const [signUpResult, uploadResult] = await Promise.allSettled([signUpPromise, uploadPromise]);

        const results = [
            {
                status: signUpResult.status,
                value: signUpResult.status === 'fulfilled' ? signUpResult.value : signUpResult.reason
            },
            {
                status: uploadResult.status,
                value: uploadResult.status === 'fulfilled' ? uploadResult.value : uploadResult.reason
            }
        ];

        return results;
    } catch (error) {
        return [{ status: 'rejected', value: error }];
    }
}

